import React,{useState,useEffect} from 'react';
import axios from "axios";
var data;
const Myfunction=()=>
{
  const [items, setItems]=useState([]);
  useEffect(()=>{
    axios.get("localhost/hotelbackend/getdata.php").then(res=>{
      setItems(res.data);
      data=res.data;
    });
  },[]);
}
export default data;
